import { TransactionType } from '../../src/types';

// Mock localStorage
const localStorageMock = (() => {
  let store: Record<string, string> = {};
  return {
    getItem: jest.fn((key: string) => store[key] || null),
    setItem: jest.fn((key: string, value: string) => {
      store[key] = value;
    }),
    removeItem: jest.fn((key: string) => {
      delete store[key];
    }),
    clear: jest.fn(() => {
      store = {};
    }),
  };
})();

Object.defineProperty(window, 'localStorage', { value: localStorageMock });

// Mock fetch
const mockFetch = jest.fn();
global.fetch = mockFetch;

// Import after mocking
import { apiClient } from '../../src/services/api';

describe('ApiClient', () => {
  beforeEach(() => {
    jest.clearAllMocks();
    localStorageMock.clear();
    // Reset token in apiClient
    apiClient.clearToken();
  });

  describe('Token Management', () => {
    it('should set token and store it in localStorage', () => {
      apiClient.setToken('test-token');

      expect(localStorage.setItem).toHaveBeenCalledWith(
        'authToken',
        'test-token',
      );
      expect(apiClient.getToken()).toBe('test-token');
      expect(apiClient.isAuthenticated()).toBe(true);
    });

    it('should clear token from localStorage', () => {
      apiClient.setToken('test-token');
      apiClient.clearToken();

      expect(localStorage.removeItem).toHaveBeenCalledWith('authToken');
      expect(apiClient.getToken()).toBeNull();
      expect(apiClient.isAuthenticated()).toBe(false);
    });

    it('should return false for isAuthenticated when no token', () => {
      expect(apiClient.isAuthenticated()).toBe(false);
    });
  });

  describe('Authentication Methods', () => {
    it('should login successfully', async () => {
      const mockResponse = {
        user: { id: '1', email: 'test@example.com', name: 'Test User' },
        token: 'auth-token-123',
      };

      mockFetch.mockResolvedValueOnce({
        ok: true,
        json: async () => mockResponse,
      });

      const result = await apiClient.login({
        email: 'test@example.com',
        password: 'password123',
      });

      expect(mockFetch).toHaveBeenCalledWith('/api/auth/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          email: 'test@example.com',
          password: 'password123',
        }),
      });
      expect(result).toEqual(mockResponse);
      expect(apiClient.getToken()).toBe('auth-token-123');
    });

    it('should register successfully', async () => {
      const mockResponse = {
        user: { id: '1', email: 'new@example.com', name: 'New User' },
        token: 'new-auth-token',
      };

      mockFetch.mockResolvedValueOnce({
        ok: true,
        json: async () => mockResponse,
